window.bookSummaryJSON = "<p>The story, if so it can be called, of Justin Moreward Haig is a true one, in so far that such a person does exist, although, as explained later, I have been compelled for many reasons to conceal his identity. </p> <p>And I emphasize the fact of his existence because there are a number of people who may doubt the possibility of attaining to that degree of perfection which he undubitably manifested, thus crediting me with producing romance instead of fact.</p> <p> And yet, he does not, by any means, stand alone at his stage of spiritual evolution, for not only are there many more like him living among us at the present time, but if world history is to be accredited with truth, there have been hundreds as great as, and greater, than he in the past.</p>"; 
